	(5, 'nemnogo-o-nas-5', 'Немного о нас', 'Немного о нас', 'Немного о нас', 'Hakkımızda biraz', ' Приветствуем Вас на сайте одного из крупнейших поставщиков металлопроката в регионе. Наша компания специализируется на реализации металлопродукции только высокого качества. И мы рады предложить Вам огромный ассортимент черного, оцинкованного и нержавеющего металлопроката.    ', ' Приветствуем Вас на сайте одного из крупнейших поставщиков металлопроката в регионе. Наша компания специализируется на реализации металлопродукции только высокого качества. И мы рады предложить Вам огромный ассортимент черного, оцинкованного и нержавеющего металлопроката.    ', ' Приветствуем Вас на сайте одного из крупнейших поставщиков металлопроката в регионе. Наша компания специализируется на реализации металлопродукции только высокого качества. И мы рады предложить Вам огромный ассортимент черного, оцинкованного и нержавеющего металлопроката.    ', ' Bölgedeki en büyük metal kiralama tedarikçilerinden birine hoş geldiniz. Firmamız sadece yüksek kaliteli metal ürünlerinin gerçekleştirilmesinde uzmanlaşmıştır. Ve size çok çeşitli siyah, galvanizli ve paslanmaz çelik ürünler sunmaktan mutluluk duyuyoruz.', 1, '2019-10-02 13:27:44', 1, 1, ''),
	(6, 'realizatsiya-metalloprokata-6', 'Реализация металлопроката', 'Реализация металлопроката', 'Реализация металлопроката', 'Metal haddeleme uygulaması', ' Для крупных заказчиков мы готовы поставить большие партии продукции по самым низким ценам. Для розничных клиентов у нас также подготовлены интересные предложения.   ', ' Для крупных заказчиков мы готовы поставить большие партии продукции по самым низким ценам. Для розничных клиентов у нас также подготовлены интересные предложения.   ', ' Для крупных заказчиков мы готовы поставить большие партии продукции по самым низким ценам. Для розничных клиентов у нас также подготовлены интересные предложения.   ', 'Büyük müşteriler için, en düşük fiyatlarla büyük toplu ürünler tedarik etmeye hazırız. Perakende müşterileri için ilginç teklifler de hazırladık.', 1, '2019-10-02 13:28:14', 1, 1, ''),
	(8, 'biz-barada-8', 'Biz barada', 'О нас', 'About Us', 'Hakkımızda', '<p> “Nowa Hyzmat” HK-sy bu pudaklarda giňişleýin tejribä eýe bolup, Siziň üçin zerur bolan işleriniň ähli göwrümini ýokary hilli we çalt yerine ýetirilmeginde kepil geçýär. Her bir sargydyň amala aşyrylmagynda esasy biz tarapymyzdan ýerine ýetirilen işleriň hiline dykgat edýäris.\r\n\r\nBiz özümiziň meşhur adymyzy bir gezeklik girdeji üçin howp astyna salmaga däl-de, eýsem gurluşyk işlerinde, metal gurluşlaryň has çylşyrymly uly göwrümleriniň önümçiligi we gurnamasy, daşary ýurtlarda dürli sargytlary we olaryň kepillik hyzmatlary pudaklarynda öz professional işlerimiz döwründe eýe bolan abraýymyzy gymmat tutýarys.\r\n\r\nBiz öz iş pudaklarymyzy we olaryň ulanylmagyny bilýäris we öz Buýrujylarymyz bilen bilimlerimizi paýlaşmakdan kanagatlanma duýýarys. Şeýlelikde ähli sargytlar we gurluşyk işler üçin doly howpsuzlyk, ýeňillik, uzyn ömürlik, tygşytlylyk, şeýle hem olaryň bejeriş we demontažynyň ýönekeýligi bilen häsiýetlendirilýäris.\r\n\r\nBiz her bir Buýrujy ilkinji nobatda maliýe ýagdaýynyň çalt we tygşytly bolmagyna üns berýändiklerini gowy bilýäris we bu talaplara laýyklykda öz işlerimizi amala aşyrmaga jan edýäris.\r\n\r\n“Nowa Hyzmat” HK ähli iş we sargytlaryň amala aşyrylmagy bilen baglanyşykly jogapkärçiligi kabul etmekden uly buýsanç duýýarys we Sizi biziň müşderilerimiziň arasynda görmäge örän şat.</p><p><br></p><table class="table table-bordered"><tbody><tr><td><p><img src="data:image/jpeg;base64," data-filename="1920x610-1.jpg" style="width: 100%;"><br></p></td><td><p><img src="data:image/jpeg;base64," data-filename="1920x610-5.jpg" style="width: 100%;"><br></p></td></tr></tbody></table><p>          </p>', ' Имея в достаточной степени обширный опыт в данных сферах деятельности, ИП «Нова Хызмат», может гарантировать качественное и быстрое выполнение всего объема необходимых Вам работ. При выполнении каждого заказа основное внимание мы уделяем качеству выполненных нами работ.\r\n\r\nМы дорожим той репутацией, которую успели заслужить за период нашей профессиональной деятельности в сферах строительных работ, производство и монтаж более сложных в большом объеме метал конструкции, различных заказов за границы и их гарантийных услуг, а не потому заинтересованы рисковать своим добрым именем ради сиюминутной одноразовой прибыли. Все работы, заказы для строительных объектов, мы стараемся выполнить на высокопрофессиональном качественном уровне.\r\n\r\nМы знаем о своих сферах работ и их использовании, и с радостью поделимся своими знаниями с нашими Заказчиками. Так, для всех заказов и строительных работ характерны такие несомненные достоинства, как абсолютная надежность и непроницаемость, легкость, долговечность, экономичность, а также простота их ремонта и демонтажа.\r\n\r\nМы прекрасно знаем, что каждый Заказчик заинтересован в первую очередь в быстром и экономичном в финансовом отношении, и мы стараемся осуществлять собственную деятельность исходя из соответствия данным требованиям.\r\n\r\nИП “Нова Хызмат” будет испытывать огромную гордость, приняв на себя обязательство по осуществлению всех заказов и работ, и мы будем рады видеть и Вас в числе наших постоянных клиентов.\r\n\r\n          ', ' “Nova Hyzmat” individual enterprise has rather wide experience in these fields of activity, and thus, it can guarantee high-quality and fast execution of total volume of works that you require. In course of execution of each order, we pay particular attention to quality of works that we carry out.\r\n\r\nWe value the reputation that we have already gained within the period of our professional activity in the spheres of construction works, manufacture and assembly of more complicated and extended metal ware, various orders that we receive from abroad including after-service, and hence, we wouldn’t endanger our good name for an immediate and single profit. We do our best to carry out all types of works, orders for building projects at high-quality professional level.\r\n\r\nWe have total data on our spheres of activity and their application, and we would be glad to share this information with our Clients. For example, successful and timely execution of all types of orders and construction works requires such obvious values, as absolute reliability and impermeability of materials, their lightness, durability, affordability as well as easiness of their repair and dismantling.\r\n\r\nWe know perfectly well that every Client is first of all interested in fast and low-cost execution of orders, and we strive for execution of our activity relying on compliance with these requirements.\r\n\r\n“Nova Hyzmat” individual enterprise will consider it a great honor to undertake commitment regarding execution of all orders and construction works, and we will be glad to have you among our regular clients as well.          ', 'Bu faaliyet alanlarında yeterince geniş deneyime sahip olan SP «Nova Khizmat", ihtiyacınız olan tüm iş hacminin kaliteli ve hızlı bir şekilde uygulanmasını garanti edebilir. Her siparişin yerine getirilmesinde, yaptığımız işin kalitesine odaklanıyoruz. Biz inşaat, üretim ve metal inşaat, yurt dışında çeşitli siparişler ve bunların garanti hizmetleri büyük miktarda daha karmaşık montaj alanlarında profesyonel faaliyet dönemini kazanmak için zaman vardı itibar beslemek ve bu nedenle bir anlık tek seferlik kar uğruna iyi bir isim riske ilgilenen değil. Tüm işler, inşaat tesisleri için siparişler, son derece profesyonel bir kalite seviyesinde gerçekleştirmeye çalışıyoruz. Çalışma alanlarımızı ve kullanımlarımızı biliyoruz ve bilgimizi müşterilerimizle paylaşmaktan mutluluk duyuyoruz. Bu nedenle, tüm siparişler ve inşaat işleri için mutlak güvenilirlik ve geçirgenlik, hafiflik, dayanıklılık, ekonomi ve onarım ve sökme kolaylığı gibi tartışılmaz avantajlar ile karakterizedir. Her müşterinin öncelikle finansal olarak hızlı ve ekonomik olarak ilgilendiğini biliyoruz ve bu gerekliliklere uygun olarak kendi faaliyetlerimizi gerçekleştirmeye çalışıyoruz. SP "Nova Hizmat", tüm siparişlerin ve işlerin uygulanmasına bağlı kalarak büyük bir gurur duyacaktır ve sizi sadık müşterilerimiz arasında görmekten mutluluk duyacağız.  ', 1, '2019-10-03 17:11:23', 1, 1, '/template/nowah/img/600x600-1_269287110_309600830.jpg'),
	(9, 'yangyn-binasynyn-metal-gurnamalary-we-fasadynyn-gaplama-isleri-9', 'ÝANGYN BINASYNYŇ METAL GURNAMALARY WE FASADYNYŇ GAPLAMA IŞLERI', 'МЕТАЛЛИЧЕСКИЕ КОНСТРУКЦИИ ПОЖАРНОГО ЗДАНИЯ И ОБЛИСОВКА ФАСАДА ПОЖАРНОГО ЗДАНИЯ', 'STEEL STRUCTURE OF FIRE FIGHTING CENTER AND FACADE COVERING WORKS', '', ' DAŞOGUZ HOWA MEŇZILI\r\nBUÝURUJY: ÖSÖŞ GURLUŞYK H.K. ', ' СТРОИТЕЛЬСТВО ПРОТИВОПОЖАРНОЙ СЛУЖБЫ В АЭРОПОРТУ ГОР. ТАШАУЗА\r\nЗАКАЗЧИК: И.П. ОСУШ ГУРЛУШЫК ', '  ', ' ', 3, '2019-10-03 17:14:01', 1, 1, '/template/nowah/img/600x600-4_888366699.jpg');
